import '../App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form action="/login" method="POST">
          <label for="email">Email: </label>
          <input id="email" name="email"></input>
        </form>
      </header>
    </div>
  );
}

export default App;
